        <form action=""><h3>complete</h3>
        <h5>Email</h5>
        <input type="text" name='email' placeholder='anastasia@gmail.com'/>
        </form>
      </div>

      <Buttons>
        <div>
          <form action="">
            <h5></h5>
          </form>
        </div>
      </Buttons>
    </Container>


  )
}

